import React from "react";
import Card from "../../components/Card/Card";
import { useNavigate } from "react-router-dom";


export default function DashboardAdmin() {
    const nav = useNavigate();
    return (
        <div style={{ padding: 24 }}>
            <h2>Dashboard do Administrador</h2>
            <div style={{ display: "flex", gap: 16, marginTop: 16, flexWrap: "wrap" }}>
                <Card title="Gerenciar Idosos" description="CRUD de perfis de idosos" onClick={() => nav('/admin/idosos') }>
                    <div style={{ marginTop: 12 }}><button onClick={() => nav('/admin/idosos')}>Abrir</button></div>
                </Card>


                <Card title="Gerenciar Familiares" description="CRUD de familiares" onClick={() => nav('/admin/familiares') }>
                    <div style={{ marginTop: 12 }}><button onClick={() => nav('/admin/familiares')}>Abrir</button></div>
                </Card>


                <Card title="Logs" description="Visualizar logs do sistema" onClick={() => nav('/admin/logs') }>
                    <div style={{ marginTop: 12 }}><button onClick={() => nav('/admin/logs')}>Abrir</button></div>
                </Card>
            </div>
        </div>
    );
}
